import requests

from common.check_result import ApiTestCase
from common.data import data
from common.errCode import const
from common.log import LOG
from common.util import Util
from config.read_config import ReadConfig


class Measurements(ApiTestCase):
    u"""提交测量"""

    def setUp(self):
        LOG.info('测试用例开始执行')

    def tearDown(self):
        LOG.info('测试用例执行完毕')

    host = ReadConfig().get_http('url')

    def measurement(self, user_id, data0, data1, mac,mobile_type, app_heart_rate,app_highest_heart_rate,app_lowest_heart_rate,finger,record_type,measurement_posture):
        data = {
            "measurement": {
                "user_id": user_id,
                "data0": data0,
                "data1": data1,
                "mac": mac,
                "mobile_type": mobile_type,
                "app_heart_rate": app_heart_rate,
                "app_highest_heart_rate": app_highest_heart_rate,
                "app_lowest_heart_rate": app_lowest_heart_rate,
                "finger": finger,
                "record_type": record_type,
                "measurement_posture": measurement_posture
            }
        }
        url = self.host + "owner/measurements"
        # url = urljoin(self.host,'owner/measurements')
        LOG.info("请求url:%s" % url)
        LOG.info("请求参数:%s" % data)
        res = requests.post(url=url, params=data, headers=Util().get_token())
        return res.json()

    def test_get_measurement_correct_parameters(self):
        u"""正确参数"""
        data = {
            "measurement": {
                "user_id": 786,
                "data0": "~",
                "data1": "",
                "mac": "304511440CCF",
                "mobile_type": "ANDROID",
                "app_heart_rate": 80,
                "finger": 4,
                "record_type": 9,
                "measurement_posture": 1
            }
        }
        url = self.host + "owner/measurements"
        result = requests.post(url=url, json=data, headers=Util().get_token_username())
        print(result.json())
        LOG.info("获取测试结果：%s" % result.json())
        self.assertOkResult(result.json())
        LOG.info("------pass!---------")

