    def test_get_measurement_err(self):
        u"""正确参数"""
        data = {
            "measurement": {
                "user_id": 127399,
                "data0": "",
                "data1": "",
                "mac": "304511440CCF",
                "mobile_type": "ANDROID",
                "app_heart_rate": 80,
                "app_highest_heart_rate": 90,
                "app_lowest_heart_rate": 70,
                "finger": 4,
                "record_type": 9,
                "measurement_posture": 1
            }
        }
        url = self.host + "owner/measurements"
        result = requests.post(url=url, json=data, headers=Util().get_token())
        print(result.json())
        LOG.info("获取测试结果：%s" % result.json())
        self.assertErrorResult(result.json(),const.ErrSubscriptionExpired)
        LOG.info("------pass!---------")

